def solve(strings):
    reversed_strings = []
    for string in strings:
        reversed_strings.append(string[::-1])
    return reversed_strings

def solve(lst):
    for i in range(len(lst)):
        lst[i] = lst[i][::-1]
    return lst

def solve(list_of_strings):
    reversed_strings = []
    for string in list_of_strings:
        reversed_strings.append(string[::-1])
    return reversed_strings
